DROP TABLE IF EXISTS `zac_sub_account_base`;
CREATE TABLE `zac_sub_account_base` (
  `id` bigint(20) unsigned NOT NULL COMMENT '唯一标识',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `modify_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `account_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '账户id',
  `sub_account_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '子账户id',
  `balance` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '子账户余额',
  `usable_balance` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '可用余额--未启用',
  `unusable_balance` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '不可用余额(冻结)--未启用',
  `type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '子账户类型,code=SUB_ACCOUNT_TYPE',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '账户状态,code=ACCOUNT_STATUS',
  `belong_to_account_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '所属账户',
  `expire_date` datetime DEFAULT NULL COMMENT '过期日期',
  `version` int(10) unsigned NOT NULL DEFAULT '1' COMMENT '更新版本号',
  `creator_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '创建人',
  `modifier_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '修改人',
  `record_status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态(0无效1有效)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='账户中心-子账户基础信息表';

